function getHtmlData(n){var t="";return n.forEach(function(n){t+=`<tr>
                       <td>
                          ${n.emailUser}
                       </td>
                       <td>
                           ${n.date}
                       </td>
                       <td>
                          ${n.operation}
                       </td>
                       <td>
                          ${n.tables}
                       </td>
                   </tr>`}),t}$("#formGroup").ready(function(){var n=new Date,t=new Date(n.getTime()).setDate(n.getDate()+7);document.getElementById("startDate").valueAsDate=n;document.getElementById("endDate").valueAsDate=new Date(t)});$("#getJournalDataClick").click(()=>{$("#journal-content").empty();$("#journal-content").append('<hr> <div class="sbl-circ-dual"><\/div> <hr>');var n={email:$("select#email option:checked").val(),startDate:$("#startDate").val(),endDate:$("#endDate").val()};$.post("/Journal/Filter/",n).done(function(n){n.length===0?(showModalDialog(["Дані відсутні."]),$("#journal-content").empty()):($("#journal-content").empty(),$("#journal-content").append(`<div class="row main-block">
                                                <table class="table text-left">
                                                    <thead>
                                                        <tr>
                                                            <th>
                                                                Email
                                                            </th>
                                                            <th>
                                                                Дата та час
                                                            </th>
                                                            <th>
                                                                Операція
                                                            </th>
                                                            <th>
                                                                Дані
                                                            </th>
                                                            <th></th>
                                                        </tr>
                                                    </thead>
                                                    <tbody>
                                                          ${getHtmlData(n)}
                                                    </tbody>
                                                </table>
                                              </div>`))}).fail(function(n){showModalDialog(n.responseJSON);$("#journal-content").empty()})});